// src/components/Services.js
import React from 'react';
import './Services.css';

const Services = () => {
  return (
    <div className="services">
      <h1>Services</h1>
      <ul className="services-list">
        <li>
          <img src="/path/to/service1.jpg" alt="Service 1" />
          <h2>Web Development</h2>
          <p>Creating responsive and dynamic websites tailored to your needs.</p>
        </li>
        <li>
          <img src="/path/to/service2.jpg" alt="Service 2" />
          <h2>Mobile App Development</h2>
          <p>Designing and developing mobile applications for iOS and Android platforms.</p>
        </li>
        <li>
          <img src="/path/to/service3.jpg" alt="Service 3" />
          <h2>General Programming</h2>
          <p>Offering programming solutions in various languages and frameworks.</p>
        </li>
      </ul>
    </div>
  );
};

export default Services;
